import React from 'react'
import "./hero.css"

const HeroSection = () => {
  return (
    <>
    <section>
    <div className="tp-slider-3-wrapper fix p-relative">
            <div className="tp-slider-3-arrow-box">
               <button className="slider-prev active">
                <i className="fa-solid fa-arrow-left-long"></i>
               </button>
               <button className="slider-next">
                <i className="fa-solid fa-arrow-right-long"></i>
               </button>
           </div>
           <div className="tp-slider-dots dots-color"></div>
            <div className="swiper-container tp-slider-3-active">
               <div className="swiper-wrapper">
                  <div className="tp-slider-3-shape-2 d-none d-sm-block">
                     <img src="assets/img/hero/shape-3-2.webp" alt=""/>
                  </div>
                  <div className="tp-slider-3-shape-3 d-none d-md-block">
                     {/* <img src="assets/img/hero/shape-3-3.webp" alt=""/> */}
                  </div>
                  <div className="swiper-slide">
                     <div className="tp-slider-3-height p-relative">
                        <div className="tp-slider-3-shape-1 d-none d-xl-block">
                           <img src="assets/img/hero/shape-3-1.webp" alt=""/>
                        </div>
                        <div className="tp-slider-3-bg" data-background="assets/img/hero/hero-3-1.webp"></div>
                        <div className="container">
                           <div className="row">
                              <div className="col-xl-12">
                                 <div className="tp-slider-3-content z-index-3">
                                    <div className="tp-slider-3-title-box">
                                       <span className="tp-slider-2-subtitle pb-5"><i></i>WE ARE BEST WIRE MANUFACTURER INDUSTRY</span>
                                       <h1 className="tp-slider-3-title mb-40">Wired for Excellence <br/>Connected for Life</h1>
